import React from 'react';
import Layout from '../components/MyLayout';

const Cart = (props) => {
  return(
    <Layout>
      <h1>Welcome to the cart page</h1>
      <h2>List:</h2>

      <h3>
        <ul>
          {this.state.data.map(show => (
            <li key={show.imdbID}>

            </li>
          ))}
        </ul>
      </h3>
    </Layout>
  )
}

export default Cart;
